import Header from "./Header";

function Main() {
  

  return (
    <>
      <Header />
      <main className="content">
      <section className="elements">
        {cards.map((card) => {
          return (
            <Card
              key={card._id}
              prop={card}
              onCardClick={onCardClick}
              onCardLike={onCardLike}
              onCardDelete={onCardDelete}
            />
          );
        })}
      </section>
    </main>
    </>
  );
}

export default Main;
